    const page = () => {
        props.carsHandler();
    }
    const carL = carList.map((item) => {
        <h3>{item.name}</h3>
        console.log(item);
    });
    return (
        <div className="popular">
            <div className="popular_section">
                <div className="popular_section_title">
                      <h1>Popular Cars</h1>
                </div>
                <div className="popular_section_content">
                <div className = "grid" >
                    {carL}
                </div>
                </div>
            </div>
              
        </div>
    )
}

